import React from 'react';
import './SearchPage.css';
import { useStateValue } from '../components/StateProvider';
import useGoogleSearch from '../components/useGoogleSearch';
import { Link } from 'react-router-dom';

function SearchPage() {
  const [{ term }, dispatch] = useStateValue();
  const {data} = useGoogleSearch(term);
  console.log(data);

  return (
    <div className='searchPage'>
      <div className='searchPage__header'>
        <div className='searchPage__headertop'>
            <h1>Digital Crowbar{term}</h1>
        </div>
        <div className='searchPage__headerbottom'>
          <Link to='/about'>Obfuscated Search</Link>
          <Link to='/store'>Image Search</Link>
          <Link to='/gmail'>Recent Searches</Link>
        </div>
      </div>

      <div className='searchPage__results'></div>
    </div>
  );
}

export default SearchPage;
